[32976] = {sourceQuests={32975},crs={72754},description="The final treasure you're looking for is high up at the bloody lake where Garnia lives.\n\nTo get there use the Albatross Taxi Service: Move to 33.3 - 55.3 (the entrance of Celestial arena). Once there, check the sky and wait for a Highwind Albatross arriving. Hit the bird once then press Escape to stop autoattack. It will pick you up to the sky and transport above the whole isle.\n\nAt 64.5 - 27.5 above the Ruby Lake (the reddish tarn on the map) begin to attack your Albatross again. The bird will instantly dive and releases you as you kill it. Swim out of the red pool and go up to the tree. You'll find the final treasure right there.",providers={{"n",72755}},coords={{64.5,27.5}}},
