[43828] = {providers={{"n",111704}},sourceQuests={43787,43788,43789,43790,43791},isDaily=true,npcID=-159,description="If the event roll was successful, you'll see an emote from Cote "Shepherd" Metcalf saying "Success!".\n\nYou should find a Volatile Sheep on the stairs at the entrance to the class hall. Spam click it.\n\nIf this quest has a checkmark next to it and you didn't see Cote's dialogue emote, then that means that you should come back tomorrow.",icon="Interface\\Icons\\INV_Staff_2h_SheepStick_D_01"},
