[47863] = {coords={{66,36.5,641}},description="|cFFFFFFFFStep 8:|r This step requires visiting |cFFFFD700Val'sharah|r.  Head to |cFFFFFFFF66.0, 36.5|r.  Inside the house next to |cff863325Wraithtalon|r is a |cFFFFD700Nightmare Tumor|r.  Click it to start the next puzzle.\n\n|cffcc33ffTips: Hit Alt+Z to hide your interface and then scroll into first-person view.  You can also use the right mouse button to turn your character around for easier viewing.|r\n\nThis puzzle is similar to |cFFFFD700Blingtron's Circuit Design Tutorial|r or the ley line puzzles in |cFFFFD700Nazjatar|r.\n\nThe object of the puzzle is to untangle all of the lines so that none cross each other and turn blue.  Once you complete it, another |cFFFFD700Inconspicuous Note|r will appear.  Click it.  The note reads...\r\r|cFFFFFFFFWhat you seek is buried within.|r\n",model="1661948",objectID=272181,sourceQuests={47852}},
