[48967] = {coords={{80.5,62.7,885},{84.6,81,885}},isDaily=true,npcID=127700,description="In order to summon this boss you need to combine the |cFFFFD700Smashed Portal Generator|r with |cFFFFD700Conductive Sheath|r, |cFFFFD700Arc Circuit|r and |cFFFFD700Power Cell|r to create the |cFFFFD700Vishax's Portal Generator|r.  You only need to do this once.\n\nOnce you create the item you will be given the quest |cFFFFD700Commander on Deck|r to go to coordinates |cFFFFFFFF77.55, 74.75|r.\n\nThe parts drop off the elite mobs that are on board the Terminus docks and ship.  There is a portal located at |cFFFFFFFF80.50, 62.70|r that will allow you to go on to the ship.",modelScale=0.63},
